import React from 'react';

function Contact() {
  return (
    <div id="contact">
      <h2>Contact</h2>
      <p>You can reach me at <a href="mailto:skylar.fynboh@littlehawksustainability.com">skylar.fynboh@littlehawksustainability.com</a>.</p>
    </div>
  );
}

export default Contact;
